#
# Structure for table "t_zot_card"
#

DROP TABLE IF EXISTS `t_zot_card`;
CREATE TABLE `t_zot_card` (
  `card_no` varchar(128) NOT NULL,
  `cust_id` varchar(128) NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `class_code` varchar(10) NOT NULL,
  `balance` float(10,2) NOT NULL,
  `remark` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`card_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "t_zot_card"
#


#
# Structure for table "t_zot_card_class"
#

DROP TABLE IF EXISTS `t_zot_card_class`;
CREATE TABLE `t_zot_card_class` (
  `class_code` varchar(10) NOT NULL,
  `class_name` varchar(20) NOT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `last_upd_time` timestamp NULL DEFAULT NULL,
  `serv_disratio` int(10) NOT NULL,
  `prod_disratio` int(10) NOT NULL,
  `min_amount` float(10,2) NOT NULL,
  `remark` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`class_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "t_zot_card_class"
#


#
# Structure for table "t_zot_card_log"
#

DROP TABLE IF EXISTS `t_zot_card_log`;
CREATE TABLE `t_zot_card_log` (
  `id` varchar(64) NOT NULL,
  `cust_id` varchar(128) NOT NULL,
  `card_no` varchar(26) NOT NULL,
  `oper_id` varchar(26) NOT NULL,
  `log_type` char(1) NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `amount` float(10,2) NOT NULL,
  `before_balance` float(10,2) NOT NULL,
  `after_balance` float(10,2) NOT NULL,
  `remark` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "t_zot_card_log"
#


#
# Structure for table "t_zot_cost"
#

DROP TABLE IF EXISTS `t_zot_cost`;
CREATE TABLE `t_zot_cost` (
  `COST_ID` varchar(50) NOT NULL,
  `COST_CAR_NO` varchar(30) DEFAULT NULL,
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `COST_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `COST_TYPE` varchar(20) NOT NULL,
  `COST_SUBTYPE` varchar(20) NOT NULL,
  `COST_AMOUNT` float(10,2) DEFAULT NULL,
  `COST_OPERATOR` varchar(20) DEFAULT NULL,
  `BALANCE` float(10,2) DEFAULT NULL,
  `REMARK` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`COST_ID`),
  KEY `cost_index_costtime` (`CREATE_TIME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

